'use strict';

jQuery(document).ready(function () {
    jQuery('.animate-box').addClass("hidden").viewportChecker({
        classToAdd: 'visible animated fadeIn',
        offset: 150
    });
});

$(window).scroll(function () {
    var scroll = $(window).scrollTop();

    if (scroll >= 200) {
        $("header").addClass("sticky");
    } else {
        $("header").removeClass("sticky");
    }

    if (scroll >= 50) {
        $("#page-title").addClass("fade");
    } else {
        $("#page-title").removeClass("fade");
    }
});

$("#nav").accessibleMegaMenu({
    uuidPrefix: "accessible-megamenu",
    menuClass: "nav-menu",
    topNavItemClass: "nav-item",
    panelClass: "sub-nav",
    panelGroupClass: "sub-nav-group",
    hoverClass: "hover",
    openClass: "open"
});

$(".nav-item > a").focus(function () {
    $(this).parent().find(".sub-nav").add(this).addClass("focus");
});

$("#nav > ul > li").hoverIntent({
    sensitivity: 3, // number = sensitivity threshold (must be 1 or higher)
    interval: 200, // number = milliseconds for onMouseOver polling interval
    timeout: 100, // number = milliseconds delay before onMouseOut
    over: function over() {
        $(this).removeClass("hoverOut").toggleClass("hoverIn");
    },
    out: function out() {
        $(this).removeClass("hoverIn").toggleClass("hoverOut");
    }
});

$(window).on('load', function () {
    // makes sure the whole site is loaded
    $('#preloader').delay(350).fadeOut('slow'); // will fade out the white DIV that covers the website.
    $('body').delay(350).css({ 'overflow': 'visible' });
});

jQuery("#responsive-headline").fitText(0.5, { minFontSize: '50px', maxFontSize: '200px' });

$(function () {
    $('.hero-banner a[href*="#"]:not([href="#"])').click(function () {
        if (location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') && location.hostname == this.hostname) {
            var target = $(this.hash);
            target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
            if (target.length) {
                $('html, body').animate({
                    scrollTop: target.offset().top
                }, 1000);
                return false;
            }
        }
    });
});

(function ($) {
    "use strict";

    var openBtn = $("#open-button"),
        colseBtn = $("#close-button"),
        menu = $(".menu-wrap");
    // Open menu when click on menu button
    openBtn.on("click", function () {
        menu.addClass("active");
    });
    // Close menu when click on Close button
    colseBtn.on("click", function () {
        menu.removeClass("active");
    });
    // Close menu when click on anywhere on the document
    $(document).on("click", function (e) {
        var target = $(e.target);
        if (target.is(".menu-wrap, .menu, .icon-list, .icon-list a, .icon-list a span, #open-button") === false) {
            menu.removeClass("active");
            e.stopPropagation();
        }
    });
})(jQuery);
"use strict";

$(document).foundation();
